import React, { useState } from 'react'
import { LeftDiv } from '../SignIn/SignIn'
import CustomInput from '../../Components/CustomeInput/CustomInput'
import styles from './LoginIn.module.css'
import { SlEnvolope, SlUser, SlLock, SlEye} from "react-icons/sl";
import CustomBtn from '../../Components/CustomeBtn/CustomBtn';


const RightDiv = () => {
    const [Email, setEmail] = useState('')
    const [Password, setPassword] = useState('')
    return(
        <div className='flex w-[60%] h-full justify-center p-10'>
            <div className='w-[90%] flex flex-col items-center justify-center'>
                <div className='mx-auto flex-col flex items-center'>
                    <h3 className='text-4xl font-semibold'>Welcome Back!</h3>
                    <p className='w-[80%] text-sm leading-2'>Unite with the finest team for seamless Urban Roads Connectivity in th North Rift</p>
                </div>
                <div className='flex justify-center items-center w-[100%] mt-10'>
                    <form className='flex flex-col items-center justify-center w-[100%]'>
                        <CustomInput 
                            ContainerStyles={styles.ContainerStyles}
                            placeholder='Email Address'
                            InputStyles={styles.InputStyles}
                            IconBefore={SlEnvolope}
                            IconStyleBefore={styles.IconStyle}
                            type='email'
                            maxLength={40}
                            value={Email}
                            onChange={()=> {
                                setEmail()
                            }}
                        />
                        <CustomInput
                            ContainerStyles={styles.ContainerStyles}
                            placeholder='Password'
                            InputStyles={styles.InputStyles}
                            IconBefore={SlUser}
                            type='text'
                            maxLength={20}
                            IconStyleBefore={styles.IconStyle}
                            value={Password}
                            onChange={() => {
                                setPassword()
                            }}
                            Ic
                        />
                        <CustomBtn
                            text='Connect...'
                            ContainerStyle={styles.ButtonContainer}
                            type='submit'
                        />
                    </form>
                </div>
            </div>
        </div>
    )
}

const LoginIn = () => {
    return (
        <div className='flex align-middle'>
            <LeftDiv/>
            <RightDiv/>
        </div>
    )
}

export default LoginIn
